※ディーラーOPナビに使用する場合はこちらも必要となります。<br><br>
■バックカメラを取付する際に面倒だった、バックゲートからナビ裏までの配線作業が不要になるキットです！<BR>
■取付がカプラーON方式なので簡単！<BR>
■車両純正の配線を使用するので確実な取付が、簡単に行えます<BR>
□商品内容<BR>
プリウスα専用カプラー2個<br>
（ナビ裏用 1個、バックゲート内用 1個）
<br><br>
【対応車種】トヨタ プリウスα<br>【年式】2011/05～<br>【型式】ZVW40/ZVW41<br>
<BR>
■別売オプション品<br>
<FONT COLOR="RED">→『汎用バックカメラ』はこちらから</FONT><br><br>
■プリウス専用 バックカメラ同梱セット<br><FONT COLOR="RED">→『バックカメラキット』はこちらから</FONT><br><br>
■プリウスα専用 バックカメラ同梱セット<br><FONT COLOR="RED">→『バックカメラキット』はこちらから</FONT><br><br>

※納期にお時間頂く場合がございます。
お急ぎの方は、ご注文前にお問い合わせ下さい。 
<BR><br><br>

